import './pageSix.css'
import Title from './components/title_bar'
import Navbar from './components/nav_bar'
import Font from './components/fnt_sze'


export default function  Organization(){
    const [Lang,SetLang]=React.useState('EN')

let LangEN,LangDE,grd_LangEN,grd_LangDE;

if(Lang === 'EN'){
    LangEN = 'block'
    LangDE = 'none'
    grd_LangEN='grid'
    grd_LangDE='none'
} else if (Lang === 'DE'){
    LangDE='block'
    LangEN='none'
    grd_LangDE='grid'
    grd_LangEN='none'
}

const [Fntsze,SetFntsze]=React.useState(20)


    return(

        <div>

            <Title/>

            <Navbar onUpdate = {(value:string) => SetLang(value)} pg_Organization = '4px solid red' />

            <div className='txt_box'>

                 <h1 style={{display:LangEN}}>Organization</h1>
                 <h1 style={{display:LangDE}}>Organisation</h1>

                 <Font fntSlct={(sze:number)=>SetFntsze(sze)} LangEN={LangEN} LangDE={LangDE}/>

                 <hr></hr>

                 <p style={{display:LangEN}}>The committee consists of:</p>
                 <p style={{display:LangDE}}>Der Vorstand besteht aus:</p>





            </div>



        </div>
    )
}
